import Vue from 'vue'
import Router from 'vue-router'
import Login_Reg from './views/Login_Reg.vue'
import Index from './views/Index.vue'

Vue.use(Router)
export default new Router({
  routes: [
    {
      path: '/login_reg',
      name: 'login_reg',
      component: Login_Reg
    },
    {
      path: '/index',
      name: 'Index',
      component: Index
    }
  ]
})
